EziBuy is committed to protecting the privacy of your personal information. We manage your personal information in an open and transparent   way.
EziBuy will only use your personal information when it is necessary for us to deliver you a service or perform other necessary business   functions and activities.
EziBuy will not use or disclose your personal information for purposes unrelated to our business activities and the services we provide, unless we first obtain your consent.



This privacy policy sets out how we comply with our obligations under the:

Privacy Act 1988 (Australia); and
Privacy Act 1993 (New Zealand).

EziBuy is bound by the requirements of these laws, which regulates how we may collect, use, disclose and store your personal information.    These laws also specify how individuals may access and correct information held about them.
“Personal Information” means information or an opinion about an identifiable individual (or an individual who is reasonably identifiable),   whether true or not, or recorded in a material form or not. For example, this type of information could include your name, contact details, age and address.
In this policy ‘we’, ‘us’, ‘our’ and ‘EziBuy’ refers to (and this policy applies to) EziBuy Limited (NZBN: 9429039761811), EziBuy Australia   Limited (NZBN:9429036208371), EziBuy Operations Limited (NZBN:9429035680604), and its subsidiaries.
If you have any questions regarding EziBuy’s Privacy Policy, please call us on 0508 500 500 or email us at   mail@ezibuy.co.nz. If you would like EziBuy to send you a hard copy of this policy, please contact us and we will do so.
We may review this policy from time to time and will notify you of any changes by posting an updated version on our website. Your use of our   website following any updates constitutes acceptance of this policy as amended. We recommend you regularly review the policy when you visit our website. This document   represents our privacy policy as at September 2015.
