EziBuy will only collect your personal information by lawful and fair means, and not in an unreasonably intrusive manner.
It is EziBuy’s usual practice to collect information directly from you when you:

become an EziBuy customer;
register with any of our other marketing programs;
place an order with us or complete any online form on one of our websites or online payment gateways;
arrange the collection of an item through our ‘Click & Collect’ service (which will require you to verify your identity);
establish an account;
visit or use an EziBuy website, including any forums, (this may include the address of your Internet service provider, the name of the web page directing you   and your clicks and activity on our website);
subscribe to marketing and sales material or communications;
complete an online form on one of our social media channels (for example, Facebook);
complete a survey;
enter a trade promotion or competition;
register a gift card;
complete an online form on one of our online advertisements that is placed on a third party website;
complete a hard copy form or provide information in one of our stores;
complete and return to us a hard copy form that is provided with one of our products;
request delivery of products;
make a purchase, return or exchange a product where we request you to verify your identity;
provide feedback via phone, e-mail, chat or social media;
speak with us, or one of our representatives directly during a product or sales enquiry; or
contact us directly by telephone, via mail, e-mail or online (inbound and outbound calls to the EziBuy Call Centre will be recorded).

We may collect information about you from a third party or a publicly available source, but only if you have consented to such collection, or   would reasonably expect us to collect your personal information in this way.
Where we can, we will allow you to deal with us anonymously or by using a pseudonym. For example, if you wish to review a product or make a   comment about our service, you are able to do this anonymously.
However, in some circumstances, EziBuy may need to collect your personal information to provide you with a delivery or other service. In some   cases, if you do not provide the required personal information we will not be able to provide you with that service.
If we receive information about you from a third party and it is not information we need in respect of our business activities, we will destroy   or de-identify that information (provided it is lawful to do so).  If we receive information in error (e.g. via social media) we will act promptly to remove the   content.
