Any personal information that you provide via our websites or directly is collected and managed by EziBuy.
If you provide your personal information to a third party via a link from an EziBuy website, that information is collected and managed by those   third parties. You should familiarise yourself with their privacy policy prior to deciding whether you wish to provide them with your information.
The types of personal information EziBuy may collect includes your:

name;
date of birth;
gender;
marital status and family details (this may include the name of a child if a personalised product is ordered);
residential, business and postal address;
email address;
contact telephone numbers;
identification details;
password for online access;
your Everyday Rewards number;
testimonials or opinions;
photos of you;
financial information, such as credit card details;
written or verbal contact with EziBuy, including voice recordings of telephone conversations you have had with our employees;
information relating to your access to our website;
information provided to NZ Post;
activities, including but not limited to lifestyle and other interests.

EziBuy also collects personal information (which may include sensitive information) from its employees (past, current and future) in order to   provide a range of employment related services.
EziBuy collects personal information directly from job applicants (and their referees) or from recruitment agencies and related service   providers.  The information we collect may include your name, address contact details, employment and education history, the names of your referees and other relevant information. This information we collect about you will be used for recruitment purposes and may be disclosed to third party service providers who provide recruitment related services to us.
Whilst you may opt not to provide us with your personal information, you should be aware that without this personal information, we may not be able   to provide you with some of the services and/or products you are seeking.
If you provide us with information about any third party, you must obtain that person’s permission to give us the information and inform them that   you have given the information to us.
