In the course of conducting our business and providing our products and services to you, we may disclose your personal information.
We only disclose personal information for the purposes for which it was given to us, or for purposes which are directly related to one of our   functions or activities.
We do not give it to anyone else unless one of the following applies:

you have consented to the disclosure;
you would reasonably expect, or have been told (by this Policy or by other means), that your information is passed to those individuals, businesses or   agencies; or
the disclosure is otherwise required or authorised by law.

If we engage third party agents or contractors, we will take all reasonable steps to ensure that they do not breach privacy requirements in   relation to the information, before we share your personal information with them.
Back to top



We may disclose your personal information to:

another EziBuy business or another Woolworths Group business or entity;
to companies that perform services on our behalf such as printers, post suppliers, delivery companies, data entry service providers, trade promotion or gift   card administration, account management providers, IT companies that manage and maintain our database, survey companies acting on our behalf and digital marketing   agencies (for the purposes of targeting on social media);
professional advisers (such as lawyers or auditors);
payment systems operators and financial institutions;
organisations authorised by EziBuy to conduct promotional, research or marketing activities;
upon lawful request from law enforcement agencies or government authorities; and
any persons acting on your behalf including those persons nominated by you, executors, trustees and legal representatives.

In all circumstances where your personal information is disclosed, we will take all steps reasonable to ensure that these third parties   undertake to protect your privacy.  Data is always transferred via Secure File Transfer Protocol.
