We are committed to compliance with all laws and requirements relating to the use of your personal information.  We will only use or disclose   your personal information for direct marketing purposes if you have provided your information for that purpose (and you would expect us to use the information for that   purpose), or if you have provided consent for your information to be used in this way (for example, though a catalogue, email or direct mail permission).
When we contact you it may be by mail, telephone, email, SMS/text message or social media message.
Where we use or disclose your personal information for the purpose of direct marketing, we will:

allow you to request not to receive direct marketing communications (also known as ‘opting-out’); and
comply with your request to ‘opt-out’ of receiving further communications within a reasonable timeframe.

You can subscribe to promotional and marketing email communications by registering for My Account here. The boxes to subscribe for email, catalogue, DM or phone communications will be   pre-ticked. If you are registering for My Account and do not wish to receive email communications please remember to un-check this box.
By subscribing to our email, you consent to receiving emails which promote and market our products and services, or the products and services   of others, from time to time.
You can unsubscribe from our email communications at any time by clicking the "Unsubscribe" link in any promotional or marketing email received   from us or by signing into My Account here and unchecking "I want to receive: Email" box or by calling us on 0508 500 500 or emailing us at mail@ezibuy.co.nz.
We use email open and click tracking including cookies, a single pixel image for tracking and link redirects for tracking clicks, for us to get   a better understanding of which email communications are of most interest to you so we can provide you with a better experience by sending relevant and interesting   email communications.
From time to time, we may contact you with information about products and services offered by us and our related entities or our business   partners, which we think may be of interest to you.  These related entities and business partners may include (but are not limited to):

Onecard
Air New Zealand; and
Other Woolworths Divisions (e.g Woolworths online shopping, NZ Wines).

