We use Remarketing through Google Analytics and other third party providers to advertise online by delivering EziBuy ad content to you which is   specifically targeted to your interests based on your visits to our website. Third-party vendors, including Google and Bazaarvoice, show EziBuy ads on sites across the   Internet.
EziBuy website visitors who wish to opt out of Google Analytics or Bazaarvoice for Display Advertisers and/or customized Display Network ads   can do so by visiting Google's Ads Preferences Manager or Bazaarvoice's opt-out mechanisms (the NAI opt-out page or the DAA opt-out page). You can also download the   Google Analytics Opt-out Browser Add-on.
Back to top



Our website uses a technology called cookies. A cookie is a small element of data that our website may send to your computer. Any such cookie   is typically stored on your computer's hard drive and permits our website to recognise you when you return. Our use of cookies helps us to provide you with a better   experience during your use of our website by allowing us to understand what areas of the site are of interest to you. You may configure your web browser to not accept   cookies, although you may experience a loss of functionality as a result.
Reputable third party vendors, including Google and Bazaarvoice, show advertisements for our products on various sites on the internet. EziBuy   and third-party vendors, including Google and Bazaarvoice, use first-party cookies (such as the Google Analytics cookie) and third-party cookies (such as the   DoubleClick cookie) together to inform, optimize, and serve ads based on someone's past visits to our website. If you would like to opt out of the use of cookies for this purpose, please visit Google's Ads Preferences Manager (and select Opt Out from the left hand menu and   follow the prompts) or Bazaarvoice's NAI opt-out page or DAA opt-out page.
Back to top



Your personal information may be disclosed to other Woolworths Group entities, business partners and EziBuy’s service providers in Australia   and overseas.
The countries this information may be disclosed to will vary from time to time, but may include Australia, New Zealand, Holland, Germany and   the United States of America.
Sometimes we use third party platforms and services to process sales, provide web support, send marketing messages, deliver products or   otherwise deliver information. These services are hosted and managed by organisations other than ourselves, and some of these services are hosted overseas.
Your personal information may be stored in a secure and encrypted form overseas (e.g. in data storage and cloud computing facilities operated   by us (or by third parties on EziBuy’s behalf).
