Our website may contain links to other sites that are not under our control. These websites may use cookies.  It is the responsibility of those third parties to collect appropriate consents from you in order to permit their own cookies (to the extent this is required by law) and to inform you about the cookies they use.  You   should check the privacy policy on all third party websites to ensure you are comfortable with third party cookies (Bazaarvoice's privacy policy can be found here:   Bazaarvoice Privacy Policy). We have no responsibility for linked websites, and provide them solely for your information and convenience.  We specifically disclaim   responsibility for their content, privacy practices and terms of use, and we make no endorsements, representations or warranties about their accuracy, content or   thoroughness.  Your disclosure of personal information to third party websites is at your own risk and we recommend that you check the privacy policies of these third   parties prior to providing them with your personal information.
No links may be made to our website without our prior written consent.
