You are able to make changes to your personal information via our website or contact centre. You can also request access to the personal   information we hold about you at any time (online, over the phone or instore (New Zealand), and we will provide you with that information unless we are prevented by   law from giving it to you.
If we are unable to give you access to the information you have requested, we will give you reasons for this decision when we respond to your   request.
You will not be charged for accessing your information, although we might have to charge the reasonable cost of processing your request,   including photocopying, administration and postage. We will advise you of any fee payable before we process your request.
If you believe that your personal information is not accurate, complete or up to date, please amend via the website, contact us via email to   mail@ezibuy.co.nz or address your request to The Privacy Officer, EziBuy Limited, Private Bag 11000, Palmerston North, 4442 New Zealand and we will correct this   information.



